import React from 'react'
import styled from 'styled-components'
import SearchBar from './components/search/SearchBar'

const Container = styled.div`
  background: #304352;  /* fallback for old browsers */
  background: -webkit-linear-gradient(to right, #d7d2cc, #304352);  /* Chrome 10-25, Safari 5.1-6 */
  background: linear-gradient(to right, #d7d2cc, #304352); /* W3C, IE 10+/ Edge, Firefox 16+, Chrome 26+, Opera 12+, Safari 7+ */

  width: 800px;
  height: 475px;
  display: flex;
  margin: auto;
  border-radius: 30px;


`
const Wrapper = styled.div`
  display:flex ;
  margin:auto ;
  width: 725px;
  height: 329px;
  background: rgba( 203, 200, 200, 0.15 );
  box-shadow: 0 8px 32px 0 rgba( 31, 38, 135, 0.37 );
  backdrop-filter: blur( 0px );
  -webkit-backdrop-filter: blur( 0px );
  border-radius: 10px;
  border: 1px solid rgba( 255, 255, 255, 0.18 );
`

const App = () => {
  return (   
    <Container>     
       {/* <SearchBar />            */}
      <Wrapper>
        <h3>Weather</h3>
      </Wrapper>
    </Container>
  )
}

export default App
